function App() {
  const onClick = () => {
    // Define your onClick functionality here
  };

  return (
    <div>
      <h1>Simple Slider</h1>
      <SimpleSlider />
      <PrevArrow onClick={onClick} /> {/* Use custom arrow components */}
      <NextArrow onClick={onClick} />
    </div>
  );
}

